import React, { useEffect, useState } from 'react'
import styles from '../../assets/cssModules/works.module.css'
import useAxiosFetch from '../../hooks/useAxiosFetch';
import defaultData from '../../data/defaultData.json'
import { Link } from 'react-router-dom';
import Pointer from '../../assets/images/pointer.png'

const Proprietary = () => {
    const getElement = (proprietary) => {
        return (
            <div className="col-6 col-md-4 col-lg-3 mb-4 mb-lg-5">
                <div className={styles.pic}>
                    <img
                        src={proprietary.imgURL}
                        alt="Projects"
                        className="img-fluid"
                    />
                    <div className={styles.overlay}>
                        <div className={styles.text}>
                            <span>For more information</span>
                            <p>
                                <Link to="/contact">
                                    Contact Us
                                    <img src={Pointer}alt="Pointer" />
                                </Link>
                            </p>
                        </div>
                    </div>
                </div>
                <p>{proprietary.paragraph}</p>
            </div>
        )
    }

    const [proprietaryList, setProprietaryList] = useState([]);
    const { data, fetchError, isLoading } = useAxiosFetch('http://localhost:3500/proprietar');


    useEffect(() => {
        if (isLoading) return;
        if (!isLoading && fetchError != null) {
            alert(fetchError + ' in Proprietary Projects !! Given Default');
            setProprietaryList(prevProprietaryList => defaultData.proprietary.map(proprietary => { return getElement(proprietary) }));
            return;
        }

        setProprietaryList(prevProprietaryList => (data.map(proprietary => { return getElement(proprietary) })));

    }, [fetchError, data, isLoading]);

    return (

        <section id="proprietary-projects" className={styles.proprietary}>
            <div className={`container ${styles.noPadContainer}`}>
                <h2>PROPRIETARY-PROJECTS</h2>
                <div className="row">
                    {proprietaryList}
                </div>
            </div>
        </section>

    )
}

export default Proprietary;
